import React, { Component } from 'react';

export default class AddNameBtn extends React.Component{

    render(){
        return(
            <div className="btn-wrap">   
                  <button className="addNameBtn" onClick={this.props.addName}>Add Name</button>
            </div>
        )
    }
}
